import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App flex w-full">
      <header className="App-header flex justify-between items-center bg-white shadow-lg rounded">
        <div className='Logo-box'>
          <img src={logo} alt='Logo'></img>
        </div>
      </header>
    </div>
  );
}

export default App;
